  let scaledValue = biomeValue * 4.0;
  
  // Get integer biome IDs for interpolation
  let biomeId0 = u32(floor(scaledValue));
  let biomeId1 = u32(ceil(scaledValue));
  let t = fract(scaledValue); // Interpolation factor
  
